import {PURPLE} from "../../helpers/colors";

const SearchContact = () => {
    return (
        <div className="input-group mx-2 w-75">
            <input type="text" className="form-control" placeholder="Search Contact" aria-describedby="basic-addon1"/>
            <span className="input-group-text" id="basic-addon1" style={{backgroundColor: PURPLE}}>
                <i className="fas fa-search"></i>
            </span>
        </div>
    )
}
export default SearchContact;
